mments_page','newest','yes'),(75,'comment_order','asc','yes'),(76,'sticky_posts','a:0:{}','yes'),(77,'widget_categories','a:2:{i:2;a:4:{s:5:\"title\";s:0:\"\";s:5:\"count\";i:0;s:12:\"hierarchical\";i:0;s:8:\"dropdown\";i:0;}s:12:\"_multiwidget\";i:1;}','yes'),(78,'widget_text','a:8:{i:1;a:0:{}i:3;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:169:\"<h2><strong>Solid Tires &bull; Rubber Tracks</strong><br/>\r\n<i>Never Stop Moving<i/></h2> \r\n<br/>\r\n<a class=\"button clear white\" href=\"#front-page-6\">Request a Quote</a>\";s:6:\"filter\";b:0;}i:4;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:763:\"<h2>The Nighthawk Advantage</h2>\r\n<div class=\"one-third first\">\r\n<h3>Best Value</h3>\r\n<div class=\"content third_img1\">\r\nWe are committed to providing our products at an extraordinary value. We stand behind our pledge  with Nighthawk\'s Best Value Guaranty.\r\n</div>\r\n</div>\r\n\r\n<div class=\"one-third\">\r\n<h3>Solid Warranty</h3>\r\n<div class=\"content third_img2\">\r\nOur reputation for providing exceptional products is only as strong as our word. Our products are backed by the industry\'s leading warranty.\r\n</div>\r\n</div>\r\n<div class=\"one-third\">\r\n<h3>Superior Performance</h3>\r\n<div class=\"content third_img3\">\r\nFeaturing our proprietary rubber compound and premium materials, our products a designed for maximum performance in the toughest conditions.\r\n</div>\r\n</div>\";s:6:\"filter\";b:0;}i:5;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:904:\"<h2>Nighthawk’s Tracks and Tires</h2>\r\n<div class=\"one-half first\">\r\n\r\n<h4>Dura-Core™ Rubber Tracks</h4>\r\n<ul>\r\n<li>Specially Designed for Compact Track Loaders</li>\r\n<li>Constructed from Our Proprietary Rubber Compound</li>\r\n<li>Maximum Performance in the Toughest Conditions</li>\r\n<li>Enhanced Reliability and Value</li>\r\n</ul>\r\n<a class=\"button clear white\" href=\"http://www.nighthawktires.com/aftermarket-rubber-tracks/dura-core-rubber-tracks-for-compact-track-loaders/\">Learn More</a>\r\n</div>\r\n\r\n<div class=\"one-half last\">\r\n\r\n<h4>Dura-Flex® Solid Tires</h4>\r\n<ul>\r\n<li>Guaranteed 100% Flat-Proof</li>\r\n<li>Constructed from Our Proprietary Rubber Compound</li>\r\n<li>Superior Resistance to Abrasion, Cutting and Chunking</li>\r\n<li>Less Downtime and Lower Cost-Per-Hour</li>\r\n</ul>\r\n<a class=\"button clear white\" href=\"http://www.nighthawktires.com/solid-skid-steer-tires/\">Learn More</a>\r\n</div>\";s:6:\"filter\";b:0;}i:6;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:468:\"<div class=\"one-third first\">\r\n<img src=\"/wp-content/uploads/2016/02/logo_bottom.png\">\r\n</div>\r\n<div class=\"two-third\">\r\n<div class=\"vertically_center\">\r\n<h2>Nighthawk\'s Best Value Guaranty</h2>\r\n<p>Our customers deserve the best, so we won\'t be beaten on price. Nighthawk will match any written quote for comparable products.</p><p>Our exceptional quality combined with the industry\'s leading warranty means we will always deliver the best value.</p> \r\n</div>\r\n</div>\";s:6:\"filter\";b:0;}i:7;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:36:\"<h2>Quote</h2>\r\n[fs_form form=\"130\"]\";s:6:\"filter\";b:0;}i:8;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:316:\"<img src=\"http://www.nighthawktires.com/wp-content/uploads/2016/03/cropped-nighthawktires-logo-final-2-1.png\" alt=\"nighthawktires-logo-final-2\" width=\"300\" height=\"63\" class=\"alignnone size-medium wp-image-684\" />\r\n<span>Call Us Today: <span class=\"fs-phone-route\" data-phone-route=\"237\">(855) 429-5669</span></span>\";s:6:\"filter\";b:0;}s:12:\"_multiwidget\";i:1;}','yes'),(79,'widget_rss','a:2:{i:1;a:0:{}s:12:\"_multiwidget\";i:1;}','yes'),(80,'uninstall_plugins','a:3:{s:39:\"bj-lazy-load/inc/class-bjll-options.php\";s:14:\"__return_false\";s:35:\"seo-redirection/seo-redirection.php\";s:14:\"WPSR_uninstall\";s:51:\"seo-redirection-premium/seo-redirection-premium.php\";a:2:{i:0;s:25:\"seo_redirection_installer\";i:1;s:9:\"uninstall\";}}','no'),(81,'timezone_stri