ss=\"Apple-converted-space\">  </span>We combine superior technology, expert manufacturing, and premium materials to create a product you can trust. </span></p>\r\n<p class=\"p1\"><span class=\"s1\">Our tracks are the ultimate in product performance, reliability, and value; making Nighthawk Dura-Core™ Rubber Tracks the ideal choice for compact track and multi-terrain loaders.</span></p>\r\n<p class=\"p3\" style=\"text-align: center;\"><span style=\"color: #ff0000;\"><em><strong><span class=\"s1\">Nighthawk Keeps You Moving When The Job Depends On It.</span></strong></em></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b><i>Call us today </i></b>at<b><i> </i></b><span class=\"fs-phone-route\" data-phone-route=\"237\">855-429-5669</span> or <a href=\"http://www.nighthawktires.com/contact/\">contact us</a> and our team will help you find the best tracks for your application.</span></p>','Dura-Core Rubber Tracks for Compact Track Loaders','','publish','closed','closed','','dura-core-rubber-tracks-for-compact-track-loaders','','','2016-04-24 17:14:49','2016-04-24 22:14:49','',750,'http://nighthawktires.yourdevelopment.ws/?page_id=632',0,'page','',0),(635,1,'2016-02-25 06:02:44','2016-02-25 12:02:44','<p class=\"p1\"><span class=\"s1\"><strong>Nighthawk Dura-Flex ® Solid Tires</strong> are built strong for maximum performance in all types of terrain and operating conditions.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">We combine superior technology, expert manufacturing, and premium materials to create a product you can trust.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Our aperture design is specifically engineered for heavy loads, providing a smooth, cushioned ride without the bounce associated with pneumatic or foam-filled tires.<span class=\"Apple-converted-space\">  </span>This unique design reduces operator fatigue and offers greater stability control.</span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b>Nighthawk Dura-Flex </b><strong>Solid Tires</strong> are the ideal choice for skid steer loaders.</span></p>\r\n<p class=\"p4\" style=\"text-align: center;\"><span class=\"s1\" style=\"color: #ff0000;\"><b><i>Nighthawk Keeps You Moving When The Job Depends On It.</i></b></span></p>\r\n<p class=\"p1\"><span class=\"s1\"><b><i>Call us today </i></b>at<b><i> </i></b><span class=\"fs-phone-route\" data-phone-route=\"237\">855-429-5669</span> or <a href=\"http://www.nighthawktires.com/contact/\">contact us</a> and our team will help you find the best tracks for your application.</span></p>','Dura-Flex Solid Skid Steer Tires','','publish','closed','closed','','dura-flex-solid-skid-steer-tires','','','2016-04-24 16:47:47','2016-04-24 21:47:47','',724,'http://nighthawktires.yourdevelopment.ws/?page_id=635',0,'page','',0),(641,1,'2016-02-25 06:04:18','2016-02-25 12:04:18','<p class=\"p1\"><span class=\"s1\"><strong>Nobody knows quality like Nighthawk.</strong><span class=\"Apple-converted-space\">  </span>Since 2010, we’ve been an industry leader in solid tires and tracks.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">We’re committed to providing extraordinary value to our customers, and built our reputation on delivering products of superior quality and reliability.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">We deliver on this commitment with </span><span class=\"s2\" style=\"color: #ff0000;\"><b><i>The Nighthawk Advantage</i></b> </span><span class=\"s1\">– our promise to you to always provide:</span></p>\r\n\r\n<ul>\r\n	<li class=\"li1\"><span class=\"s1\">exceptional quality, </span></li>\r\n	<li class=\"li1\"><span class=\"s1\">the industry’s leading warranty, and </span></li>\r\n	<li class=\"li1\"><span class=\"s1\">our “best value” guarantee.</span></li>\r\n</ul>\r\n<p class=\"p1\"><span class=\"s1\">Nighthawk understands how track and tire failures can bring work to a complete stop, resulting in higher costs and lower margins.<span class=\"Apple-converted-space\">  </span>Our <strong>Dura-Core™ Rubber Tracks</strong> and <strong>Dura-Flex® Solid Tires</strong> are constructed from our proprietary rubber compound to withstand all types of terrain and operating conditions.</span></p>\r\n<p class=\"p3\" style=\"text-align: center;\"><span class=\"s1\" style=\"color: #ff0000;\"><b><i>Our Goal is to Eliminate Your Downtime.</i></b></span></p>\r\n<p class=\"p1\"><span class=\"s1\">Our team is available by phone at <b><span class=\"fs-phone-route\" data-phone-route=\"237\">1-855-429-5669</span> </b>to answer your questions and help you find the best product for your application.</span></p>\r\n\r\n<h2 class=\"p1\"></h2>\r\n<h2 class=\"p1\">Steer Clear of Service Setbacks</h2>\r\n<p class=\"p1\">We are constantly expanding our local distributor network to ensure our valuable customers have easy access to local service, support, and professional guidance.</p>\r\n<p class=\"p3\"><span class=\"s1\">In areas, where we do not have a local distributor, we are happy to go the extra mile and service our customers directly.</span></p> ','About','','publish','closed','closed','','about','','','2016-09-12 01:58:46','2016-09-12 06:58:46','',0,'http://nighthawktires.yourdevelopment.ws/?page_id=641',0,'page','',0),(646,1,'2016-02-25 06:07:28','2016-02-25 12:07:28','','Blog','','publish','closed','closed','','blog','','','2016-09-12 01:27:03','2016-09-12 06:27:03','',0,'http://nighthawktires.yourdevelopment.ws/?page_id=646',0,'page','',0),(650,1,'2016-02-25 06:10:28','2016-02-25 12:10:28',' ','','About Nighthawk Tires','publish','closed','closed','','650','','','2016-04-22 15:49:53','2016-04-22 20:49:53','',0,'http://nighthawktires.yourdevelopment.ws/?p=650',5,'nav_menu_item','',0),(655,1,'2016-02-25 06:21:10','2016-02-25 12:21:10','With Nighthawk discover the confidence of owning Dura-Core™ Rubber Tracks and Dura-Flex® Solid Tires. From the factory to the job site, we are committed to providing you with the best products, at the best value with impeccable performance.\r\n\r\nWe offer the industry\'s leading warranty - so you <span style=\"color: #ff0000;\"><em><strong>Never Stop Moving</strong></em>.</span>\r\n\r\n<strong>Nighthawk Claim Procedure:  </strong>\r\n<ol>\r\n<ol>\r\n<ul>\r\n	<li>All warranty claims must be submitted within thirty days of the date of failure.</li>\r\n	<li>All warranty claims must be submitted with the following information:\r\n<ol>\r\n	<li>Invoice or receipt showing the original date of purchase,</li>\r\n	<li>Number of service hours,</li>\r\n	<li>Product serial number,</li>\r\n	<li>Minimum of five pictures including one picture of the serial number, one picture of the entire product, and at a minimum, three pictures, of the reported failure.</li>\r\n</ol>\r\n</li>\r\n	<li>Untimely or incomplete warranty claims may be denied.</li>\r\n	<li>Upon request, the product must be returned to Nighthawk.</li>\r\n	<li>All warranty claims will be adjudicated within thirty days of receipt of the complete warranty claim.</li>\r\n</ul>\r\n</ol>\r\n</ol>\r\nFor more information about our limited warranty or how to submit a warranty claim, please contact us at <a href=\"mailto:warranty@nighthawktires.com\">Nighthawk Warranty</a>.','Nighthawk Limited Warranty','','publish','closed','closed','','warranty','','','2016-04-23 14:40:22','2016-04-23 19:40:22','',0,'http://nighthawktires.yourdevelopment.ws/?page_id=655',0,'page','',0),(657,1,'2016-02-25 06:21:43','2016-02-25 12:21:43','For additional information about product specs and features, please select the appropriate brochure below.\r\n\r\nAs always, our team is available by phone at <b><span class=\"fs-phone-route\" data-phone-route=\"237\">(281) 968-4562</span> </b>to answer your questions and help you find the best product for your application.','Nighthawk Product Brochures','','publish','closed','closed','','brochure','','','2016-04-24 09:52:09','2016-04-24 14:52:09','',0,'http://nighthawktires.yourdevelopment.ws/?page_id=657',0,'page','',0),(659,1,'2016-02-25 06:22:32','2016-02-25 12:22: