ide you with the<em> best value</em> in the solid tires and tracks.\r\n\r\nYou’ll notice a new layout with easier navigation.  All the information you need is at your fingertips.\r\n\r\nIn today’s hyper-competitive markets, we understand how tire and track failures can bring work to a complete stop, resulting higher costs and lower margins.\r\n\r\nAlong with the new website, we created<span style=\"color: #ff0000;\"> <strong><em>The Nighthawk Advantage</em></strong> </span>which is our promise to you to always provide:\r\n<ul>\r\n	<li>exceptional quality,</li>\r\n	<li>the industry’s leading warranty, and</li>\r\n	<li>our “best value” guarantee.</li>\r\n</ul>\r\nWe’re growing and expanding our local distributor network to provide you with easy access to local service, support, and professional guidance.\r\n\r\nIf you’re outside our distributor area, contact us directly.  We’re happy to help you find the best product to meet your needs.\r\n\r\n<strong>In coming months</strong>, we will be posting information via the blog to help you and your business; from providing industry and product updates to changes in the market.\r\n\r\nLet us know what you think and how we can help.\r\n\r\n<span style=\"color: #000000;\"><em>The Nighthawk Team</em></span>','Nighthawk - New Website Announcement','','publish','open','open','','nighthawk-new-website-announcement','','','2016-04-20 20:39:48','2016-04-21 01:39:48','',0,'http://nighthawktires.stagingcloud.us/?p=958',0,'post','',0),(960,1,'2016-04-20 20:26:10','2016-04-21 01:26:10','','Blog Photo','','inherit','open','closed','','blog-photo','','','2016-04-20 20:26:10','2016-04-21 01:26:10','',958,'http://nighthawktires.stagingcloud.us/wp-content/uploads/2016/04/Blog-Photo.jpg',0,'attachment','image/jpeg',0),(988,1,'2016-04-23 16:11:10','2016-04-23 21:11:10','Content-Type: text/plain; charset = \"UTF-8\"\r\nContent-Transfer-Encoding: 8bit\r\n\r\nHello!\r\n\r\nSent by Postman 1.7.2 - https://wordpress.org/plugins/postman-smtp/\r\n\r\n